import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';
import { styled, TextField, Dialog, DialogTitle} from "@material-ui/core"


class ImageZoom extends StreamlitComponentBase {
  public render = (): ReactNode => {
    return (
      <div style={{
        width: "90%",
        height: "90%",
        backgroundColor: "red",
        position: "absolute",
        top: "calc(50% - 50px)",
